import { SIGN_UP, LOGGED_IN, LOGIN_ERROR} from '../actions/types'

const intialState = {
    error: ''
}

export default function signupReducer(state = intialState, action) {
    switch(action.type) {
        case LOGIN_ERROR:
            return {
                ...state,
                error: 'email or password do not match!'
            }
        default:
            return {
                ...state
            }
    }
}
